import React from 'react';
import './About.css'; // Arquivo com os estilos
import FotoPrincipal from '../../assets/imagens/eu.jpeg';

const About = () => {
  return (
    <section id="about">
      <div className="about-photo">
        <img src={FotoPrincipal} alt="Minha Foto" />
      </div>
      <div className="about-text">
        <h1>Sobre Mim</h1>
        <p>
        Olá, meu nome é Ester e sou apaixonada por tecnologia e desenvolvimento. 
        Estou sempre buscando aprender e aprimorar minhas habilidades, explorando novas linguagens e frameworks para criar projetos criativos e funcionais. Meu objetivo é crescer na área, enfrentando desafios e adquirindo experiência para construir soluções inovadoras. 
        </p>
        <p>
          Além de programar, gosto de ler, escrever, escutar música e tocar órgão, meu instrumento. Meu objetivo é continuar aprendendo e me desafiando 
          para crescer cada vez mais na carreira.
        </p>
      </div>
    </section>
  );
};

export default About;
